        }
    }
    public StringDictionary(ICollection<string> keys, ICollection<string> japaneseStrings, ICollection<string> englishStrings) : base()
    {
        var length = keys.Count;
        for (int i = 0; i <= length; i++)
        {
            var key = keys.ElementAt(i);
            var japanese = japaneseStrings.ElementAt(i);
            var english = englishStrings.ElementAt(i);
            Strings? strings = new(japanese, english);
            this[key] = strings;
            continue;
        }
    }
}

[Serializable]
public sealed class Strings
{
    [DebuggerBrowsable(DebuggerBrowsableState.Never)]
    private string japanese;
    [DebuggerBrowsable(DebuggerBrowsableState.Never)]
    private string english;

    public Strings(string japanese, string english)
    {
        this.english = english;
        this.japanese = japanese;
    }

    public string Japanese { get => japanese; init => japanese = value; }
    public string English { get => english; init => english = value; }

    public override bool Equals(object? obj)
    {
        return base.Equals(obj);
    }

    public override int GetHashCode()
    {
        return base.GetHashCode();
    }

    public override string? ToString()
    {
        return $"jp: {japanese}\nen: {english}";
    }
}

internal interface IEnumerableName : IEnumerable<string>, IEnumerable
{

}
